from collections import deque



class Stack:

    def __init__(self):

        self.container = deque()



    def push(self, val):

        self.container.append(val)



    def pop(self):

        return self.container.pop()



    def peek(self):

        return self.container[-1]



    def is_empty(self):

        return len(self.container)==0



    def size(self):

        return len(self.container)



def reverse_string(a_string):

    s = Stack()

    for x in a_string:

        s.push(x)

    new_string = ''

    for y in range(s.size()):

        new_string += s.pop()

    return new_string



def is_balanced(a_string):

    s = Stack()

    d = Stack()

    check = Stack()

    for char in a_string:

        if char in "{}[]()":

            s.push(char)

    for char in range(len(s.container)-1, -1, -1):

        d.push(s.container[char])

    #print(s.container)

    #print(d.container)

    if len(s.container) != 0 and len(s.container) % 2 == 0:

        mean = int(len(s.container)/2)



        for i in range(mean):

            check.push(s.container[i]+d.container[i])

        for set in check.container:

            if set not in ["[]","()","{}"]:

                c = False

            else:

                c = True

    return c





